import React, { useState, useEffect } from "react";
import { AgGridReact } from "ag-grid-react";
import { Dropdown, DropdownToggle, DropdownMenu, DropdownItem, Button } from 'reactstrap';
import { Redirect } from 'react-router-dom';
import "ag-grid-community/dist/styles/ag-grid.css";
import "ag-grid-community/dist/styles/ag-theme-balham.css";
import "ag-grid-community/dist/styles/ag-theme-alpine-dark.css";
import "./ranking.css";
import "./home.css";


function Factors() {

    const [rowData, setRowData] = useState([]);
    const [selected, setSelected] = useState("");
    const [year, setYear] = useState("");

    useEffect(() => {
        fetch("http://131.181.190.87:3000/factors" + year)
            .then(res => res.json())
            .then(data =>
                data.map(company => {
                    return {
                        rank: company.rank,
                        country: company.country,
                        score: company.score,
                        economy: company.economy,
                        family: company.family,
                        health: company.health,
                        freedom: company.freedom,
                        generosity: company.generosity,
                        trust: company.trust,
                        year: company.year,
                    };
                })
            )
            .then(senData => setRowData(senData));
    }, [year]);

    function setYearFunc() {
        setYear(this.link);
    }

    function Dropdownmenu(){
        const [dropdownOpen, setDropdownOpen] = useState(false);
        const toggle = () => setDropdownOpen(prevState => !prevState);

        return (
            <Dropdown isOpen={dropdownOpen} toggle={toggle}>
                <DropdownToggle caret>
                    Year
                </DropdownToggle>
                <DropdownMenu className="industry-drop">
                    {years.map(data => (
                        <React.Fragment key={data.title}>
                            <DropdownItem onClick={setYearFunc.bind(data)}>{data.title}</DropdownItem>
                        </React.Fragment>
                    ))}
                </DropdownMenu>
            </Dropdown>
        )
    }

    function clickHander(props) {
        setSelected(props.data.year);
    }

    const columns = [
        { headerName: "Rank", field: "rank", filter: "agTextColumnFilter", filter: true, sortable: true, width:"200", flex:"300" },
        { headerName: "Country", field: "country", filter: "agTextColumnFilter", filter: true, sortable: true, width:"200", flex:"300" },
        { headerName: "Score", field: "score", filter: "agTextColumnFilter", filter: true, sortable: true, width:"200", flex:"300" },
        { headerName: "Economy", field: "economy", filter: "agTextColumnFilter", filter: true, sortable: true, width:"200", flex:"300" },
        { headerName: "Family", field: "family", filter: "agTextColumnFilter", filter: true, sortable: true, width:"200", flex:"300" },
        { headerName: "Health", field: "health", filter: "agTextColumnFilter", filter: true, sortable: true, width:"200", flex:"300" },
        { headerName: "Freedom", field: "freedom", filter: "agTextColumnFilter", filter: true, sortable: true, width:"200", flex:"300" },
        { headerName: "Generosity", field: "generosity", filter: "agTextColumnFilter", filter: true, sortable: true, width:"200", flex:"300" },
        { headerName: "Trust", field: "trust", filter: "agTextColumnFilter", filter: true, sortable: true, width:"200", flex:"300" },
      ];

    function Table(){
        return (

            <AgGridReact
                columnDefs={columns}
                rowData={rowData}
                pagination={true}
                paginationPageSize={30}
                rowSelection={true}
                onRowDoubleClicked={clickHander}
            >
            </AgGridReact>
        );
    }

    if (selected === "") {
        return (
            <div>
                <div className="jumbo">
                    <div className="transbox">
                        <div className="transMessage">
                                <div className="title">
                                    Rankings
                                </div>
                        </div>
                    </div>
                    <div
                        className="ag-theme-alpine-dark table"
                        style={{
                        height: "60vh",
                        width: "60vw",
                        marginRight: "5%",
                        marginLeft : "5%"
                        }}
                        >
                        <div className="industry-drop">
                            <Dropdownmenu />
                        </div>
                        <Table />
                    </div>
                </div>
            </div>
        )
    }
    else {
        return(
            <Redirect to={"./search" + selected} />
        )
    }




}

export default Factors;
